// Computed
const topTeethIds = computed(() => {
  return component.activeTab === 1
    ? adultTopTeethIds
    : childTopTeethIds
})
const bottomTeethIds = computed(() => {
  return component.activeTab === 1
    ? adultBottomTeethIds
    : childBottomTeethIds
})
const topDxIds = computed(() => {
  return component.activeTab === 1
    ? adultTopDxIds
    : childTopDxIds
})
const topSxIds = computed(() => {
  return component.activeTab === 1
    ? adultTopSxIds
    : childTopSxIds
})
const bottomDxIds = computed(() => {
  return component.activeTab === 1
    ? adultBottomDxIds
    : childBottomDxIds
})
const bottomSxIds = computed(() => {
  return component.activeTab === 1
    ? adultBottomSxIds
    : childBottomSxIds
})

const topTeethSelected = computed(() => {
  return difference(topTeethIds.value, component.activeTeeth).length === 0
})
const bottomTeethSelected = computed(() => {
  return difference(bottomTeethIds.value, component.activeTeeth).length === 0
})
const topDxTeethSelected = computed(() => {
  return difference(topDxIds.value, component.activeTeeth).length === 0
})
const topSxTeethSelected = computed(() => {
  return difference(topSxIds.value, component.activeTeeth).length === 0
})
const bottomDxTeethSelected = computed(() => {
  return difference(bottomDxIds.value, component.activeTeeth).length === 0
})
const bottomSxTeethSelected = computed(() => {
  return difference(bottomSxIds.value, component.activeTeeth).length === 0
})

const hasAdultTeethSelected = computed(() => {
  return intersection([...adultTopTeethIds, ...adultBottomTeethIds], component.activeTeeth).length > 0
})

const hasChildTeethSelected = computed(() => {
  return intersection([...childTopTeethIds, ...childBottomTeethIds], component.activeTeeth).length > 0
})

// Watchers
const unwatchTeeth = watch(
  () => component.activeTeeth,
  (value) => emit('update:value', value)
)

// Functions
const isActive = (id: number|number): boolean => {
  typeof id === 'string' && (id = parseInt(id))
  return findIndex(component.activeTeeth, (_id) => _id === id) >= 0
}

const toggleTooth = (id: string|number) => {
  typeof id === 'string' && (id = parseInt(id))
  const i = findIndex(component.activeTeeth, (_id) => _id === id)
  if (i < 0) {
    component.activeTeeth.push(id)
  } else {
    component.activeTeeth.splice(i, 1)
  }
}

const selectTeeth = (ids: number[], active: boolean) => {
  if (!active) {
    const missingTeeth = difference(ids, component.activeTeeth)
    component.activeTeeth.push(...missingTeeth)
  } else {
    component.activeTeeth = difference(component.activeTeeth, ids)
  }
}

onMounted(() => {
  component.activeTeeth = props.value
  if (hasAdultTeethSelected.value) {
    component.activeTab = 1
  }
  else if (hasChildTeethSelected.value) {
    component.activeTab = 2
  }
})

onBeforeUnmount(() => {
  unwatchTeeth()
})
</script>

