.tooth-area {
  fill: #25316D;
  opacity: 0;

  &:hover {
    opacity: 0.25;
    cursor: pointer;
  }

  &.tooth-active {
    opacity: 0.5;
  }
}

.tooth {
  fill: #000;
  opacity: 0.25;
  pointer-events: none;

  &.tooth-active {
    opacity: 1;
    fill: #25316D;
  }
}
</style>
